        \   <div id=\"divHealthMil\" style=\"background-color:yellow; padding:10px;
        font-size:medium; font-weight:bold; border:2px solid red; border-radius: 15px\">\r\n
        \       The DHA Immunization Healthcare Branch (IHB) website has moved to
        <a href=\"http://www.health.mil/vaccines\">www.health.mil/vaccines</a>.  The
        new website features the same information and resources you have come to expect,
        with streamlined navigation and usability and housed with all other content
        related to the Military Health System and Defense Health Agency. Please update
        your bookmarks accordingly. \r\n        <br /><br />\r\n        <a href=\"https://www.vaccines.mil/MyImzU\">Immunization
        University (IMZU)</a> and <a href=\"https://vhcprojectimmunereadiness.com/\"
        target=\"_blank\">Project Immune Readiness (PIR)</a> have been identified
        to transition to \r\n        <a href=\"https://jkodirect.jten.mil/\" target=\"_blank\">Joint
        Knowledge Online (JKO)</a>. The projected date of transition is in the first
        quarter of FY17. \r\n        Currently, Students can continue to take courses
        in both systems until the course has been transitioned to <a href=\"https://jkodirect.jten.mil/\"
        target=\"_blank\">JKO</a>. \r\n        Upon complete transition of all modules
        to <a href=\"https://jkodirect.jten.mil/\" target=\"_blank\">JKO</a>, notification
        will be distributed to all Services. Therefore, we \r\n        advise all
        students to retrieve their certificates for record keeping as soon as possible.
        \r\n        <a href=\"http://health.mil/Reference-Center/Publications/2016/10/17/Immunization-University-and-Project-Immune-Readiness-Certificate-Retrieval-Instructions\"
